import React, { Component } from "react";
import { connect } from "react-redux";
import "./invoice.css";
import { getBill } from "../BillsActions/BillsActions";
import { getClient } from "../Actions/ClientActions";
import { getOrder } from "../OrderActions/OrderActions";

export const invoiceBill = () => {
  return (
    <div className="content-wrapper">
      <div className="page-header text-blue-d2">
        <h1 className="page-title text-secondary-d1">
          Invoice
          <small className="page-info">
            <i className="fa fa-angle-double-right text-80"></i>
            ID:
          </small>
        </h1>

        <div className="page-tools">
          <div className="action-buttons">
            <a
              className="btn bg-white btn-light mx-1px text-95"
              href="#"
              data-title="Print"
            >
              <i className="mr-1 fa fa-print text-primary-m1 text-120 w-2"></i>
              Print
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => ({
  //all: state,
  //bill: state.bill,
  //client: state.client,
  //order: state.order,
  //errors: state.errors,
});

export default connect(mapStateToProps, { getBill })(InvoiceBill);
